.buffer_unordered(n) tell to the runtime how many task (i.e futures) you want to execute. 3 tasks, but 2 executed concurrently: use futures::stream::{self, StreamExt};
use tokio::task; async fn a() { println!("Starting a"); // ... do some asynchronous work ... println!("Finished a");
} async fn b() { println!("Starting b"); // ... do some asynchronous work ... println!("Finished b");
} async fn c() { println!("Starting c"); // ... do some asynchronous work ... println!("Finished c");
} #[tokio::main]
async fn main() { let tasks = vec![task::spawn(a()), task::spawn(b()), task::spawn(c())]; stream::iter(tasks) .buffer_unordered(2) // execute up to 2 tasks concurrently .collect::<Vec<_>>() .await;
} In this example, a and b will be executed concurrently, while c will be executed only after a or b completes. Conclusion Tokio runtime is designed to manage the execution of asynchronous tasks, which are represented as futures. When a future is spawned on the runtime, the runtime manages its execution and schedules it to run on one of the available threads. The runtime uses a thread pool to efficiently manage the scheduling of tasks across multiple threads, taking into account the number of available CPU cores on the machine. This allows the runtime to effectively utilize the available resources and maximize performance. TL;DR: Tokio runtime works with tasks/futures and under the hood orchestrate theses futures on threads accordingly with the number of cpu of the machine. You can change the number of threads OFC : use tokio::runtime::Builder; ... let runtime = Builder::new().num_threads($valueHere).build().unwrap();

